import React from 'react';
import './App.css';

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      nr: '',
    };
    this.cui = this.cui.bind(this);
  }

  cui(newCui){
    this.setState({nr:newCui.target.nr})
  }



  render(){
    console.log(this.state.nr)
  return (
        <div style={{margin:40}}>
          <form>
            <label>
              CUI:
              <input type="text" value={this.state.nr} maxLength={9} onChange={this.cui}/>
            </label>
            <input type="submit" value="Submit"  />
          </form>
          <p>{this.state.nr}</p>
        </div>
  );
}
}

export default App;
